namespace RonSijm.FluidHumidifier.Factories.AppStream;

public class StackFactory(string resourceName = null, Action<Humidifier.AppStream.Stack> factoryAction = null) : ResourceFactory<Humidifier.AppStream.Stack>(resourceName)
{

    internal List<InnerStackStorageConnectorFactory> StorageConnectorsFactories { get; set; } = [];

    internal List<InnerStackUserSettingFactory> UserSettingsFactories { get; set; } = [];

    internal List<InnerStackAccessEndpointFactory> AccessEndpointsFactories { get; set; } = [];

    internal InnerStackStreamingExperienceSettingsFactory StreamingExperienceSettingsFactory { get; set; }

    internal InnerStackApplicationSettingsFactory ApplicationSettingsFactory { get; set; }

    protected override Humidifier.AppStream.Stack Create()
    {
        var stackResult = CreateStack();
        factoryAction?.Invoke(stackResult);

        return stackResult;
    }

    private Humidifier.AppStream.Stack CreateStack()
    {
        var stackResult = new Humidifier.AppStream.Stack
        {
            GivenName = InputResourceName,
        };

        return stackResult;
    }
    public override void CreateChildren(Humidifier.AppStream.Stack result)
    {
        base.CreateChildren(result);

        result.StorageConnectors = StorageConnectorsFactories.Any() ? StorageConnectorsFactories.Select(x => x.Build()).ToList() : null;
        result.UserSettings = UserSettingsFactories.Any() ? UserSettingsFactories.Select(x => x.Build()).ToList() : null;
        result.AccessEndpoints = AccessEndpointsFactories.Any() ? AccessEndpointsFactories.Select(x => x.Build()).ToList() : null;
        result.StreamingExperienceSettings ??= StreamingExperienceSettingsFactory?.Build();
        result.ApplicationSettings ??= ApplicationSettingsFactory?.Build();
    }

} // End Of Class

